(121, 'Dante Fiorenza', 'fiorenzadante@gmail.com', '02215541703', 'Soy argentino, he vivido en Italia por 30 años: durante esa permanencia me he curado con éxito con la homeopatía, desde hace 6 años he regresado al país, desde entonces se verifica el hecho de que no obtengo ningún resultado terapéutico, tengo motivos para pensar que, por lo menos las farmacias homeopaticas de La PLata, entreguen solamente los glóbulos de sacarosio; no se puede producir un fármaco 30 CH ó 200 CH en 15''. Asesoro a algunos legisladores, la idea es establecer leyes que puedan garantizar la calidad de las medicinas homeopáticas, permitiendo esa realización a laboratorios que puedan demostrar seriedad y someterse a controles. Gracias. Me interesa tomar contacto con expertos en el tema!', '2016-11-07 17:22:34'),
(122, 'Dante Fiorenza', 'fiorenzadante@gmail.com', '02215541703', 'Soy argentino, he vivido en Italia por 30 años: durante esa permanencia me he curado con éxito con la homeopatía, desde hace 6 años he regresado al país, desde entonces se verifica el hecho de que no obtengo ningún resultado terapéutico, tengo motivos para pensar que, por lo menos las farmacias homeopaticas de La PLata, entreguen solamente los glóbulos de sacarosio; no se puede producir un fármaco 30 CH ó 200 CH en 15''. Asesoro a algunos legisladores, la idea es establecer leyes que puedan garantizar la calidad de las medicinas homeopáticas, permitiendo esa realización a laboratorios que puedan demostrar seriedad y someterse a controles. Gracias. Me interesa tomar contacto con expertos en el tema!', '2016-11-07 17:22:52'),
(123, 'Dr. Edgardo Schinder', 'medicinaambiental@yahoo.com.ar', '0223 155 050987 0223 5940834', 'Estimados amigos: sugieron en Mar del Plata agregar las siguientes farmacias:\nFarmacia Frontini\nFarmacia Pereda\nFarmacia Pizzolo\ntrabajan con los mejores estandares de calidad homeopática del país.\nHice el Postgrado de Homeopatía en 1971-2 cuando estaba en la calle Cangallo (actual JDPerón).\nSimultáneamente con mi residencia de Infectología en el Hospital FJMuñiz.\nAtte.', '2016-11-08 17:54:50'),
