(223, 'Marcela Giacopello', 'marcelagiacopello@yahoo.com.ar', '1131880964', 'Durante 33 años, hasta éste mes, me desempeñé como asistente/secretaria y recepcionista en el consultorio del Dr Luis Detinis. Por motivos de salud del Dr, el consultorio dejó de funcionar y me quedé sin trabajo. Después de tantos años en el cargo me manejo muy bien con los pacientes y me gustaría enviarles mi Curriculum Vitae. A dónde tengo que dirigirme? Desde ya muchas Gracias por su amable atención!!          Marcela ', '2018-04-26 23:16:03'),
(224, 'Elena ', 'yonnes@fibertel.com.ar', '47442540', 'Médico homeópata unicista en zona de San Isidro ', '2018-04-28 15:50:14'),
(225, 'Camardo Gabriela', 'gabriela_camardo@hotmail.com', '3416002585', 'Buen día \nQuisiera saber si tienen el libro " repertorio de Kent" , materia médica Vennier y Marzetti\nLos precios de c.u\nGracias por la información\n', '2018-04-29 09:00:09'),
(226, 'Mª DOLORES GARCIA-AGENJO MARIN', 'info@homeopatiayacupuntura.es', '', 'Me dirijo a ustedes porque desde hace un tiempo he visto que están utilizando nuestras siglas y no me parece correcto. Todos somos médicos y deberíamos respetarnos. Cuando registramos nuestra asociación,lo hicimos como A.M.H A. con "puntos" oara diferenciarla de su asociación y respetando la existencia de la suya aunque en otro continente. Luchamos todos por la Homeopatía. Sería posible algo recíproco? Muchas gracias', '2018-04-30 17:27:06'),
(227, 'Oscar Delgado', 'silvinaay71@gmail.com', '3764686314', 'Hola buenas tardes. Quiero saber si atienden niños. Soy de Misiones. Mi último hijo ha nacido con síndrome de down y producto de ello una cardiopatia ya resuelta quirúrgicamente. No así los efectos secundarios por haber tenido hipertensión pulmonar. La medicina tradicional sólo lo trata con corticoides y broncodilatadores y a la larga sé que no es bueno. Aguardo respuesta. Gracias', '2018-04-30 21:21:51'),
