(242, 'Andrea', 'amarch20133@gmail.com', '', 'Hola quisiera hacer una consulta. puedo tomar glóbulos de Hydrastis 30 JUNTO con DBI AP 850 metformina, para la diabetes tipo 2, REOVEX 10 rosuvastatina, para el colesterol, FILTEN 25 carvedilol, para la presión. y ahora también, que me dio mi médico un antigripal LETONDAL (tiene paracetamol 500, ambroxol HCI 30, oxatomida 30) tengo 48 años. estoy operada (vacía) desde los 33 años de útero y ovarios. garganta, y vesícula por piedra, hace más o menos desde el año 2010. ...empecé desde el mes de febrero más o menos, luego de haberme sanado de una bronquitis fuerte a los pocos dias comencé con mocosidad amarilla y hasta verdosa alrededor de 1 mes y medio o más estuve con eso, se me tapaban muchísimo la nariz, solo por nariz, luego de seguir con mocosidad amanecí un día con decaimiento. me dieron optamox duo 1 gr 14 pastillas, luego a la semana me volvieron a dar optamox duo de 1 gramo por un diente al que me tuvieron que sacar, otras 14 pastillas. parecía habían mermado pero a los 4 o 5 días volvieron nuevamente, mocosidad amarilla y espesa. siempre por nariz. me hice todos los chequeos médicos ginecológicos y salieron bien, análisis de sangre 131 glucemia, 184 colesterol, 6.600 glob blancos, plaquetas 197.000, hepatograma normal. orina 24 hs y completa normal. solamente me salió en una ecografía abdominal de control higado graso grado III . yo tenía molestias, por eso la pedí, no eran fuertes, solo leves puntadas que eran muy suaves, y yo jamás tuve molestias antes) Estoy a dieta, ya bajé 10 kilos. amén de todo esto, me decido ir al otorrinolaringólogo porque la mocosidad continuaba, sin fiebre, pero seguía, me hizo una tomografía nasal y los resultados fueron normales. el Otorrinolaringólogo además es HOMEÓPATA y me recetó HYDRASTIS 30 , GLÓBULOS DE 45 GRS Me dijo tome 10 glóbulos a la mañana y 10 glóbulos a la noche... LE HAGO ESTA CONSULTA PORQUE HE LEÍDO EN INTERNET QUE SI TOMO MEDICACIÓN DE GLUCEMIA, COLESTEROL Y SOBRE TODO HIPERTENSIÓN CONSULTE CON MI MÉDICO PARA SABER SI ME PERMITE TOMAR HYDRASTIS 30... CONSULTO A MI MÉDICO Y ME DICE QUE ÉL NO ES HOMEÓPATA Y NO CONOCE EL PRODUCTO... O SEA, NO SÉ QUE HACER Y TENGO MIEDO TENER COMPLICACIONES CON LA MEDICACÓN QUE TOMO . Puedo tomarlo?', '2018-06-04 19:08:55'),
