(267, 'Marcela Amadeo', 'marcelaamadeo@gmail.com', '1565259476', 'Hola desde hace mas de 1 año que tengo una lesion en mi cuero cabelludo pareciera que fue post un alisado desconozco si por el producto o la planchita. Vengo recorriendo desde hace mas de 1 año y medio diferentes médicos, tratamientos, biopsias sin un resultado certero y sin solución, es más se hicieron nuevas lesiones. Acaban de indicarme un tercera biopsia y sinceramente me resisto. Sinceramente me siento abatida porque no encuentran la solución. Creo en la homeopatía, hice hace tiempo algún tratamiento. Estoy segura que a traves de la homeopatia encontraré la solucion pero no tengo el dato del médico indicado, tampoco por un tema economico puedo visitar diferentes medicos hasta dar con el indicado. Quisiera si esta dentro de sus posibilidades, pedirles ayuda si pudieran recomendarme o guiarme con el dato de un homeopata que pueda tratarme en esta afección. Desde ya les quedo muy agradecida por lo que puedan hacer y a la espera de su respuesta Cariños, Marcela Amadeo', '2018-07-07 10:04:02'),
