(272, 'Miriam Sommer', 'miriamsommer@planet.nl', '+31 6 422 806 98', 'Estoy escribiendo desde Holanda.\nSoy un médico homeópata brasileño y un epidemiólogo clínico que vive en La Haya.\n\nEn el año 1982 estudié en su escuela, con el Dr. José Eizayaga, la Dra. Michaela Moize, el Dr. Bernardo Vijnovski.\n\nEstoy haciendo una investigación sobre Epidemias de Poliomielitis y consciente de que en el año 1956 o 1957 tuvo epidemias de poliomielitis en Buenos Aires, donde las personas fueron tratadas con Homeopatía.\n\n¿Es posible obtener información al respecto? ¿Quizás copias de la revista Homeopatia con artículos sobre esta epidemia?\n\nMuchas gracias por adelantado.\n\nSaludos cordiales', '2018-07-12 10:49:51'),
