(297, 'Jose Mallamace', 'mallamacejj@hotmail.com', '02364224938', 'Atte.Tuve oportunidad de consultar a Carmen vilas Palencia (en Chile).Ella me dio un tratamiento que,segun creo es positivo. Pero ahora el problema es el siguiente:Mi realidad economica me impide continuarlo,no tengo recursos para pagar el viaje y reponer la medicacion.La pregunta:¿tienen ustedes algun lugar donde yo pueda realizar la receta?', '2018-08-31 09:33:39'),
