(314, 'leandro pinheiro da fonseca forneck', 'doutorleandropinheiro@gmail.com', '+ 556286227305', 'Olá, muito bom dia tudo bem? Meu nome é Leandro e sou Pediatra na cidade de Goianésia, interior de Goiás, Brasil. Dou aula na faculdade de medicina e irei promover um debate com meus alunos a respeito da febre, pois acredito ser uma das maiores (ou a maior) causa de procura aos centros médicos. Porém também tenho uma visão benéfica da febre, com isso gostaria de saber como posso ter acesso em buscar dentro de suas referências os artigos que têm sobre esse assunto. Agradeço a oportunidade. Dr Leandro Pinheiro Pediatra', '2018-09-27 12:03:38'),
(315, 'estela camin', 'ecamin@hotmail.com', '011 4583-3546', 'por favor es por un problema familiar y necesito comunicarme con el dr. Mario Draiman, si pueden informarme el telefono, muy agradecida.', '2018-09-28 09:19:57'),
(316, 'Arroyo Lucas', 'espacioarce@hotmail.com', '1154814613', 'Buen dia, Estamos abriendo un espacio multidisciplinario, enfocado principalmente a la homeopatía. Ofrecemos consultorios por hora, módulos o jornada. Quisiera que me informaran si cuentan con algún tipo de bolsa de trabajo  para ofrecer dichos servicios.\nSaludos', '2018-09-28 12:47:51'),
(317, 'Carla', 'k_rladani@hotmail.com', '1544366156', 'Buenas noches , quería hacerles una consulta, tratan con la homeopatía la bronquioectasia? Más que nada ayudar con los intimas de la tos que le impiden a mi abuela tener un descanso apropiado, y a ayudar a su estado gral. Cuál es el valor de la consulta ? \nEspero su respuesta \nMuchas gracias ', '2018-09-30 00:47:05'),
