(320, 'Laura Martins', 'lalau0799@gmail.com', '0111562837797', 'Hola, quisiera el contacto de algun homeopata que vaya a domicilio para tratar a una paciente de 99 años con un cuadro de reuma. Esta con mucho dolor al levantarse hace aproximadamente un mes. Desde ya muchas gracias.', '2018-10-01 20:29:20'),
(321, 'Pablo Maseda', 'pablomaseda@hotmail.com', '1560999590', 'Buenos días,\nEstoy en la búsqueda de profesionales homeópatas que atiendan en zona norte. Es para consulta médica pediátrica (niño de 16 meses).\nDesde ya muchas gracias\nSaludos\nPablo', '2018-10-03 09:48:33'),
(322, 'Laura Martins', 'tao_68@hotmail.com', '1554049159', 'HOLA QUERIA SABER EL PROGRAMA DEL CONGRESO EN EL QUE ESTOY INSCRIPTA PARA PODER ORGANIZAR HORARIOS DEL CONSULTORIO. NO LO ENCUENTRO EN INTERNET. MUCHAS GRACIAS', '2018-10-03 16:47:16'),
