(324, 'Tai', 'aguadeloto@outlook.com', '', 'Hola  buenas noches soy tai les escribo por el interés que tengo por estudiar homeopatía ,medicina natural y alternativa ,bueno mi pregunta es si ahí sedes en buenos aires y Córdoba  para estudiar homeopatía desde el principio? no solo de postgrado \nCuales serian los requisitos para entrar y cual seria el costo de la carrera?desde ya muchísimas gracias', '2018-10-03 22:12:37'),
(325, 'Miriam Susana Fiorini', 'miriam4433@hotmail.com', '2914192749', 'Buenos días, me contacto con Uds para comentarles mi inquietud.\nDispongo de un espacio con comodidad para ofrecer a profesionales que quieran trabajar temporalmente o con continuidad en la ciudad de Bahía Blanca.\nEl mismo está en calle Maipu 1486 de está ciudad, en el barrio de Villa Mitre.\nPueden ver imágenes en face buscando: \nEl Ceibo, tu lugar de trabajo.\nDesde ya les agradezco la atención, y de no ser este el lugar para mi inquietud les agradecería de ser posible me orientarán en donde poder registrarla.\nMuchas gracias\nMiriam Susana Fiorini\n', '2018-10-06 12:55:50'),
(326, 'Susana Mc Kena', 'smckena@gmail.com', '03544508676', 'Estimados, escribo desde Villa Dolores, Córdoba. Quisiera contactar un Homeópata Unicista en la ciudad de Córdoba. Gracias !', '2018-10-08 11:17:32'),
(327, 'julieta carracedo', 'carracedojulieta@gmail.com', '2233029601', 'Buenos dias, quisiera saber si podrian pasarme el contacto o donde atiende la Dra. Florencia Cantilo. Desde ya muchas gracias!', '2018-10-08 12:27:02'),
(328, 'georgina gabanetta', 'georgina_gabanetta@yahoo.com.ar', '1164835059', 'Hola, quiero consultar si pueden recomendarme algún homeópata infanto en caba para mi hija de 7 años. A raíz de dos audiometrías q no dieron bien, la médica le mando una placa y una Polisomnografía. La conclusión fue que debe hacerse una cirugía de adenoides y posiblemente amigadalas. Quiero intentar otro tipo de tratamiento. ', '2018-10-09 11:48:39'),
(329, 'Marta Karasik', 'martudevoto@gmail.com', 'vivo fuera del pais', 'Necesito la ayuda de uds. para saber si conocen un homeopata unicista en Miami Beach..Aventura o el mas cercano. No es para mi ya que siempre me atendi con homeopatia y se manejarme. Es para una persona de mi familia que necesita urgentemente consultar y tratarse. Muy agradecida desde ya por su atención, espero noticias.', '2018-10-10 14:05:43'),
