(331, 'Mariana Toro', 'nanyt7@hotmail.com', '0297 154628674', 'Buenas tardes! Tengo a.mi hija con.broncoespasmo. Tiene 3 años ya estuvo internado por bonquiolitis. Necesitaría saber que médico debería consultar por este tema. Somos de Comodoro Rivadavia y hoy encontre la pagina de uds. no tengo mucho conocimiento sobre homeopatía pero necesito ayudar a mi hija a curarse. Desde ya muchas gracias por su ayuda.\nMariana', '2018-10-15 12:56:11'),
