INSERT INTO `contact_messages` (`contact_id`, `name`, `email`, `phone`, `message`, `creation_date`) VALUES
(339, 'Laura Salas', 'Laly-a45@hotmail.com', '1532719692', 'Hola! Buenas tardes, mi suegro tiene 70 años, hace 5 le diagnosticaron melanoma metastasico grado IV. Tuvo una operacion donde extrajeron el melanoma, pero hizo metastasis en los dos pulmones. Recibió inmunoterapia durante aproximadamente 3 años. Hace unos meses le diagnosticaron metastasis en la cabeza del femur, manchas en los intestinos y colon. Con respecto al hueso, recibió 5 sesiones de radioterapia. Al dia de hoy le indican que ya no hay tratamiento, él está muy caido, perdió mas de 40 kilos en el transcurso de estos años. Estamos intentando llevarlo a terapia pero nos cuesta que quiera ir. Se que es una descripcion muy larga de los hechos, pero quería que tuvieran una idea de como es el caso. Queremos realizar una consulta con uds, cómo debemos hacer? Cuánto sale la consulta? Cuánto tiempo estaría él con el medico? (pregunto porque la mayor parte del tiempo se encuentra en cama). Atienden por alguna obra social o pami? Espero que me puedan responder. Si se pueden comunicar conmigo, deberia ser de 8 a 12:30 o a partir de las 19. Aguardo respuesta. Muchas gracias!', '2018-10-24 15:49:22'),
(340, 'Graciela', 'gramfe@yahoo.com.ar', '1567530823', 'Quisiera saber quienes son los medicos que atienden en Charcas 2744 para poder pedir turno y el costo.\nsaludos cordiales.\n', '2018-10-26 08:57:52'),
(341, 'Mariana Estanga', 'marianaestanga3@gmail.com', '1561832513', 'Buen día, estoy intentando comunicarme para pedir un turno, podrían indicarme en que horario  y a que número tengo que hacerlo. Estoy intentándolo desde ayer a los distintos numeros que figuran en la página y no logro que me contesten. Muchas gracias', '2018-10-26 11:53:13'),
