(349, 'agustina', 'agus051088@hotmail.com', '2215669428', 'Buenos dias, queria preguntar si es requisito ser medico para hacer la rama de la medicina homeopatica, yo estudio medicina en la unlp y estoy averiguando , muchisimas gracias ', '2018-11-01 18:38:08'),
(350, 'liliana cora', 'verdearmonia@yahoo.com', '011031819702', 'Buenas tardes, estuve en la charla de agrohomeopatía del último sabado. No me traje la hoja donde estaba el programa de la carrera de Agrohomeopatía. \nPodrían pasarmelo o el mail del médico que dio la charla informativa, creo Dr. Martello. Desde ya muchas gracias!!!!.saludos Liliana Cora', '2018-11-02 14:17:25'),
(351, 'Ing. Daniel Maerzelli', 'danielmarzelli@gmail.com', '3462670311', 'Favor indicarme algún profesional de esa escuela ejerciendo en la ciudad de Rosario. Gracias', '2018-11-05 19:02:52'),
(352, 'CLARISA DE ROSSO', 'saiindijsm@gmail.com', '', 'Buen dia, tengo una llamada perdida de ustedes.\nEsta semana tengo un turno para atenderme pero extravié el papel donde lo anoté. Podría recordarme el dia y horario asignado?\nTambién me gustaría saber si atienden los dias sabados. Gracias\nClarisa\n', '2018-11-12 10:03:09'),
(353, 'Claudia', 'claudiabertani8@gmail.com', '0111536410229', 'Hola quisiera saber si con homeopatía puedo controlar mejor un problema de hipertensión.\nMuchas gracias', '2018-11-13 09:13:28'),
(354, 'Ramón Eduardo caseres Domínguez', 'reymondominguez47@outlook.com', '1156160991', 'Mí consulta es porque tengo 51años estoy un poco expedido de peso tengo presión alta y se me elevó la glucemia  y como consecuencia tengo poca erección porfa me avisas si me puede ayudar?', '2018-11-13 19:02:05'),
(355, 'Miguel Kancepolsky', 'kanteich@gmail.com', '(011)51375801', 'Qué tal, mi consulta es por atención médica para tratar un hipotiroidismo causado por el tratamiento con yodo radioactivo, realizado para controlar mi previo hipertiroidismo.\nDicho tratamiento se realizó hace 7 años, y luego tomé levotiroxina por aproximadamente 4, hasta que decidí dejarla.\n¿Cómo funciona el sistema de consultas médicas? ¿tengo que pedir turno o puedo acercarme a la Sede Central (vivo en CABA)?\nMuchas gracias,\nMiguel\n\n', '2018-11-14 15:12:02'),
(356, 'Jimena, Santuccio ', 'jimenita_st@hotmail.com', '1567428683', 'Buen día, mi nombre es Jimena. Soy médica y estoy finalizando la especialidad en pediatría. Estoy interesada en iniciar la carrera de homeopatía el próximo año. Quisiera saber cuándo puedo inscribirme y el arancel.\nDesde ya muchas gracias. \nSaludos, Jimena', '2018-11-15 11:52:07'),
