(359, 'Nadia castro', 'Dranadiacastro@gmail.com', '099293630', 'Buenos dias soy de Uruguay quisiera que me informaran del curso de homeopatia intensivo. Quisiera saber como es la cursada ya que deberia saber cuantas veces deberia viajar. Quisiera tambien saber el costo del mismo. Gracias', '2018-11-16 10:23:41'),
