(363, 'jessika quintero', 'administracion@rascontenedores.com', '3173834473', 'Buenas tardes, me podrias por favor si la carrera de medicina homeopatica se puede tomar a nivel virtual?', '2018-11-22 15:39:38'),
(364, 'Mery', 'merybern@gmail.com', '1125363147', 'Vuenas tardes, quisiera saber la disponibilidad de tres libros con los titulos: Organon del Arte de Curar ? 6ta. Edición ?En búsqueda del pensamiento original de Hahnemann? Dr. Raúl Gustavo Pirra;\nLas Enfermedades crónicas, su naturaleza peculiar y su curación homeopática del Dr. Samuel Hahnemann, traducción Dra. Viqueira y Veterinaria Homeopatica de Horacio do Medio, muchas gracias ', '2018-11-22 18:04:58'),
