(366, 'Natalia', 'pollo7@gmail.com', 'K', 'Quisiera saber si es recomendado por la Asociación la fundación puiggros ya que me han recomendado para atenderme allí. Muchas gracias.', '2018-11-24 08:36:10'),
(367, 'Eugenia Vercellone', 'evercellone@hotmail.com', '0341155907708', 'Buenos días. Hace tiempo estoy buscando una escuela de hopmeopatia en Argentina que incluyan, además de médicos, farmacéuticos u vetrerinarios, a otros profesionales de la salud. Ejerzo como bioquímica,  Medicina Tradicional China, terapeuta Floral, ex docente de la Facultad de Ciencias Médicas Universidad Nacional de Rosario.  Les agradeceré información sobre  la posibilidad de estudiar en su Escuela.\nAtentamente, \nEugenia Beatriz Vercellone', '2018-11-24 09:20:44'),
