(370, 'Germàn Prada', 'medicosinfronteralatino@gmail.com', '3177182260', 'COMUNICADO  PARA LOS MEDICOS HOMEOPATAS TANTO HUMANO COMO VETERINARIO\n                                                                       DE HABLA HISPANA\nAl dirigirnos a las organizaciones medicas homeopáticas de habla Hispana y el   Mundo,  va con la finalidad de estrechar nuestro vínculo profesional, ético y científico,  en aras del crecimiento y desarrollo de la Ciencia en cumplimiento ?de la  maestría científica de Hhanemann Mundialmente conocido como la Medicina  Homeopática  ley de la similitud?.\nEn  estas  circunstancias; la organización Medico sin Frontera Latino; INFORMA: sobre  el lanzamiento oficial   de una Revelación que tendrá lugar en el mes de octubre los días 12- 13 y 14 del año   2.019. Mediante el cual, se dará a conocer públicamente lo debidamente anunciado en la pagina que al final se expone.\nAl relacionar lo que corresponde a la parte científica según la mencionada revelación; nuestra información  va encaminado  anunciar que dos libros científicos  que vienen tratando asuntos de suma importancia para los médicos homeópatas del mundo,  ya  están a su  disposición cuyos nombres son: ?EL HOMBRE QUE CURÒ EL SIDA? Y  LA HOMEOPATIA Y FARMACOPEA MEDICINA DEL SIGLO XXI. En consecuencia agradecemos que al analizar con detenimiento lo encontrado dentro de la web allí,  encontrara los correos de  contactos  para su debida información y adquisición de las mencionadas obras. Como  adelanto  de la información sobre el porqué de la gran importancia para los facultativos  en este entorno, tiene que ver con la entrega del tratamiento sobre el sida, por parte de los Homeópatas   considerado preferentemente  de suma importancia \nCordialmente.  Org.  De Homeopática siglo xxi.\n  Web: germprad.simplesite.com\n', '2018-12-03 13:04:40'),
