(441, 'MARIA EUGENIA FLORES', 'mariaeugeniajflores@gmail.com', '', 'Buentas tardes:\nUna pena no haber podido acceder a su cartilla, debido a la frialdad y celeridad con que fui atendida por la secretaria. Estaba decidiendo en qué horario podría ir a una primera consulta, me dijo que tenía una llamda en espera y que la llame luego porque me estaba costando decidir. Estabamos en comunicación hacía tres minutos. Si una institución que se presenta diferente al paradigma médico hegemónico y actúa así , es dificil confiiar en sus servicios. ATTE.', '2019-03-18 12:35:14'),
