(448, 'Cristian Begega', 'cristianbegega@gmail.com', '1530192216', 'Hola! Cómo están?\n\nQuería consultar por días y horarios de los turnos en los consultorios de Charcas. También los costos.\n\nEs la primera vez que haría homeopatía, lo comento por si la primera sesión será algo distinta o más extensa.\n\nMuchas gracias!!!', '2019-03-21 17:40:27'),
