(469, 'Natalia urti', 'natalia.urti@gmail.com', '1149708586', 'Hola, estoy buscando un médico homeópata que sea especialista en dificultades respiratorias. Mi hija tiene 9 meses sufrió su primer bronquiolitis a los 3 y a partir de ahí lo intenté casi todo y genera episodios de broncoespasmo casi todas las semanas. Estoy tratando de encontrar una ayuda para que pueda vivir un poco mejor. \nYo estoy en caba villa dévoto. Estuvo buscando médicos pero no encuentro en el buscador cercano a mi zona ya sea urquiza Pueyrredón villa del parque, ningún especialista en estos temas. Podrá alguien asesorsrme? \nSe los agradezco de todo corazón.\nSaludos ', '2019-04-16 04:05:31'),
(470, 'guillermo tellechea', 'gttellgui1@gmail.com', '011 1541609246', 'hola soy lic en kinesiologia y experto en medicina china, hay cursos o formaciones presenciales o a distancia , en homeopatia sin ser medico?', '2019-04-16 18:44:13'),
