(478, 'Marcela LOPEZ', 'lopez_mb@hotmail.com', '3426148531', 'Buenos días, podrían informarme los médicos homeópatas de la provincia de Santa Fe. Quiero hacer una consulta y me gustaría hacer con un profesional.\nAtte.\nMarcela', '2019-04-24 13:09:02'),
(479, 'Carla Cescon', 'fam.milan@libero.it', '00393485332386', 'Buenas tarde,  yo vivo en Italia y en este momento tengo un grave problema de piel,  lamentablemente los homeópatas que he consultado en la zona donde yo vivo, noreste de Italia , no sigen absolutamente la escuela de los homeópatas argentinos,  ninguna primera consulta larga, dedicada, por ejemplo. Quería saber si Uds me pueden recomendar alguna asociación o profesional en Italia que tenga la misma característica de los homeópatas argentinos, y tb saber si es possibile \nen todo caso hacer consultas con Uds on line, via skype, whatsapp etc.\nLes agradezco desde ya infinitamente,\nCarla Cescon Milan', '2019-04-24 13:23:50'),
(480, 'Flavia Fanello', 'flaviafanello@hotmail.com', '1157524903', 'Hola! Quisiera saber si pueden recomendarme algún homeópata infantil en zona sur (Adrogué, Lomas, Lanús)\nGracias!!', '2019-04-26 19:22:57'),
