(484, 'Edith Diaz', 'edithdiaz2302@hotmail.com', '11 5852 0175', 'Buenos días,\nQuisiera atenderme con un médico homeópata,la obra social IOMA no me cubre el serficio ni tiene reintegro y los honorarios a pagar me resultan muy caros. Quisiera saber si uds tienen una opción de honorarios mas accesibles,cuánto sería y de que manera se puede acceder?\nMuchas gracias\nEdith Diaz', '2019-05-02 10:45:21'),
