(487, 'Solioz Daniela', 'dasolioz@hotmail.com', '0247715603847', 'hola ,soy farmaceutica , interesada en la carrera de medicina homeopatica , solo quiero saber si es posible estudiar dicha carrera via on line , dado mi carga horaria de trabajo.\nGracias', '2019-05-07 16:59:53'),
(488, 'Mariano Cucinotta', 'marianocucinotta@hotmail.com', '11-4079-3188', 'Buenas tardes. Quería saber para cuando había turno para ir a la sede de charcas, a última hora, y cuanto sale la consulta. Desde ya muchas gracias. Saludos!', '2019-05-08 18:44:40'),
(489, 'Rocio Gomez', 'rociovictoriagomez@hotmail.com', '1137682632', 'Buenas tardes, me comunico con uds por lo siguiente. Soy licenciada en historia y estoy realizando mi tesis de maestría (UNTREF) sobre una causa judicial de dos médicos homeópatas contra el consejo de higiene a fines del siglo XIX. Me interesaría poder acceder a la biblioteca o la hemeroteca de la institución, pero tengo entendido que es solo para los socios. Quería saber si hay alguna posibilidad que me permita efectuar una consulta.\nDesde ya muchas gracias por su tiempo.\nSaludos cordiales.\n\nRocío Gómez', '2019-05-10 15:10:35'),
(490, 'Aldana', 'aldanacappra@gmail.com', '1560089862', 'Buenas tardes , quería saber si trabajan con cobertura médica.de no ser así cuanto cuesta la consulta.  Es para un nene de 3 años. Saludos ', '2019-05-14 15:43:03'),
(491, 'Gabriela Suarez Conde', 'gabriela.suarezconde@gmail.com', '01157386470', 'Buen dia, necesito enviar medicamentos homeopaticos a Italia. Saben como puedo hacer? o que correo lo hace?\nmuchas gracias\n', '2019-05-15 12:52:34'),
(492, 'Tamara', 'tamyvonku@gmail.com', '', 'Quiero dar con algún medico homeopata de mi zona. Soy del norte de San Luis.', '2019-05-15 19:01:43'),
(493, 'Marcela Bonaudi', 'marcelaeditbonaudi@gmail.com', '011 1564153280', 'Hola, buen día, me interesaría ver un médico homeópata, para mí y para mis hijos. No hemos atendido con el Dr. Osvaldo Schtutman, pero al cambiarnos de domicilio, él nos facilitó este contacto para seguir los tratamientos.\nMuchas gracias.', '2019-05-18 12:06:05'),
(494, 'francisco', 'frangp.inv@gmail.com', '000000000', 'Buenos días,\n\nLes escribo para compartir con su entidad un sistema que he comenzado a desarrollar este principio de año. Lo desarrollo a madura edad, cuando he pasado gran parte de mi vida viendo los problemas de convivencia en las personas, dificultades para tomar decisiones, injusticias, etc. El sistema está en desarrollo  con varias partes, y  de las partes ya  hechas se puede sacar una enorme utilidad.\n\nComo terapeuta a su consulta o sala de trabajo, seguramente acudan muchas personas que llegan y le explican todas sus preocupaciones y pesares. En la mayoría de veces o muchas veces, no puede dar consejo o interervernir porque son decisiones de la persona. Para este tipo de personas, este trabajo les puede ser una solución. \nEn parte lo defino como el yoga de las matemáticas. Porque tiene un efecto parecido en la relajación. Al poder tomar una decisión difícil rápidamente, fácilmente y exactamente das un largo suspiro de calma y relajación. Te quitas de encima un peso. Lo mismo cuando haces una reflexión o pensamiento, cuanto más exacto és menos te equivocas y más largo es el suspiro de no alivio. Es por esta razón que le he dado es segundo nombre, de yoga de las matemáticas, porque te da calma y paz. \n\nEl método usa las matemáticas puras como referéncia para aplicarse en las decisiones y hacer una deducción, da continuidad enseñando como mejorar  comprensión descomponiendo o componiendo información, catalogando la información antes de relacionarla con la lógica, comprobar las deducciones o razonamientos de varias formas para cerciorarse que no te has equivocado, etc. Todo usando métodos matemáticos.\n    \nLes dejo estos dos enlaces que explican parte del método. Es un sistema muy muy muy sencillo y enormemente eficaz. Hasta un escolar que sepa hacer operaciones hasta divisiones lo puede llevar a cabo. \n\nhttps://www.youtube.com/watch?v=jzQDkJtJGzw\nhttps://www.youtube.com/watch?v=WLoRJ0MCOtM\n\nEn este enlace se muestra un ejemplo para la elección de una vivienda entre 6 viviendas\nhttps://www.youtube.com/watch?v=WLoRJ0MCOtM\n\nLos vídeos los pueden descargar con aplicaciones de navegador de internet y compartir sin tener que ir a you tube cada vez. Para leer online lo tienen gratis en este enlace: \n\nhttps://es.calameo.com/read/001582946983c7e339226\n  \n        \nAunque no creo que les haga falta, porque en el documento y los vídeos está bastante bien explicado, si les interesa este sistema que he llamado Yogalídof y tienen cualquier duda contacten conmigo. \n\n\n\nPor mi parte no busco fama o prestigio. Solo aporto un poco de paz a este mar llamado universo y lleno de tensiones. Espero les sirva de gran ayuda.\n\nUn saludo,\n\nFrancisco\n', '2019-05-19 18:05:33'),
(495, 'graciela clemente', 'gclemente@medusaco.com.ar', '1543991112', 'hola quería que me proveyeran de una lista de medicos unicistas que atiendan en la zona oeste o en capital federal. vivo en Ramos Mejia. además si me pueden decir en que valores rondan los honorarios. gracias', '2019-05-21 18:30:10'),
(496, 'Rosana Claudia', 'rosymobrici@gmail.com', '1533853646', 'Hola, necesito saber cual es el costo de la consulta', '2019-05-23 00:43:27'),
(497, 'Mariana Del Valle', 'marianadelvalle6@hotmail.com', '1557383052', 'buenos dias,  estoy interesada en recibir información sobre la medicina homeopática en relación a morfea y neuropatías. Muchas gracias. saludos', '2019-05-23 13:51:49'),
(498, 'Rocio Vera', '11rociovera@gmail.com', '1134343696', 'Estimado/a Buenos días, ante todo me presento mi nombre es Rocio Vera tengo 22 años, y quería consultarles si habría posibilidad de recomendarme o trabajar junto a ustedes?, por esta razón aquí me he puesto en contacto en búsqueda de empleo fijo en referencia al puesto laboral con disponibilidad Full Time, que su empresa requiera poder formar parte del proceso de selección. Me he dedicado en área de administración, soy estudiante en Lic. en Psicomotricidad. Elegí mi vocación para estar al servicio de la comunidad aportar lo que mas se necesite ayudar mientras tanto poseo experiencia previa en un departamento administración de importante Centro Psicoanalítico Argentino del sector Secretaria Recepcionista. Como competencia personal trabajo en\nequipo, orientación a resultados, compromiso, liderazgo, iniciativa...).\nEstoy interesada en unirme a su equipo de profesionales porque quiero\ncontribuir a introducir nuevos conocimientos en política de calidad. Sería un placer\npara mí poder seguir creciendo sobre mi formación profesional. Me adapto al empleo que me ofrezcan, me seria de gran ayuda económica, (remuneración en función a las horas trabajadas), dadas las condiciones del país. Para ello. Estaré a disposición. Por favor, Disculpen mi atrevimiento. Saludos cordiales Rocío Vera  ', '2019-05-26 20:54:22'),
(499, 'Victor Pichen', 'genesis_soxtay@hotmail.com', '1165470444', 'Estimado, como esta? tengo una deficiencia visual causada por lesiones del nervio optico debido a un glaucoma nivel 4\nel cual ya fue tratado con una cirugia con la tecnica de \nTrabeculectomía, ya fue regularizada la presion ocular a condiciones optimas\npero quedo como resago la vision borrosa y una mancha\nblanca en la parte central de la vision la cual impide leer o ver con agudeza.\nque medicamento me recomendaria comprar para tratarla?\ngracias por su atencion,. saludos\nVictor', '2019-05-28 11:22:37');
