(505, 'Ramiro', 'ramiromsassi@hotmail.com', '2944411564', 'Hola, quisiera saber si existe algún listado con médicos homeópatas que trabajen en San Martín de los Andes, Junín, Plottier, Neuquén Capital, Cipolletti, Gral. Roca, Villa Regina. Muchas gracias', '2019-06-03 10:40:22'),
