(507, 'Laura Moles', 'laumoles@gmail.com', '01159573442', 'Buenas tardes! Necesitaba saber si aun es posible inscribirse en la carrera de médico homeópata. Hace 3 años aproximadamente, cursé 1 mes con ustedes pero no pude seguir por falta de tiempo para realizar varios prácticos.  Tengo un concepto basico pero podria ponerme al dia. Le agraDeceria si me informan sobre los valores de la misma. Saludos', '2019-06-03 18:17:33'),
(508, 'Graciela', 'p_graciela@yahoo.com.ar', '1531835915', 'Buenas noches: quisiera saber si sólo trabajan con veterinarios o también con médicos para humanos. Necesitaría un listado de ambos, que atiendan en zona sur. Vivo en Lomas de Zamora.  Muchas gracias', '2019-06-03 22:09:21'),
(509, 'Ana', 'anamartelli@live.com.ar', '1557064710', 'Estimados\nMi nombre es Ana Martelli y soy del Municipio de San Isidro, provincia de Buenos Aires. Estoy buscando Veterinarios Homeópatas con reconocida experiencia que me puedan recomendar por zona norte y/o el norte de Capital Federal.\nCualquier información que me puedan brindar se los agradeceré.\nAtentamente, \nAna.-', '2019-06-04 15:27:02'),
(510, 'Mariana Paula de toma', 'magus31javi@hotmil.com', '1537732731', 'Buenos dias, quisiera solicitar un turno, para atender a mi hija de 17 años, tiene una bacteria multiresistente un enterobacter en el organismo y desde diciembre entro en insuficiencia renal cronica,  quisiera una consulta por favor, desde ya muchas, gracias.', '2019-06-05 08:09:50'),
(511, 'Emma Muraca', 'emma.muraca55@gmail.com', '47290533', 'Quisiera saber si hay algún homeópata iriologo ahí o en la zona de San Martín o Boulogne\nSoy de José Leon Suarez y seria cómodo algo cerca para ir. Gracias.', '2019-06-05 21:04:13'),
(512, 'Marcela', 'marcewhite1@hotmail.com', '1167119735', 'Buenos dias, quisiera que, por favor, me recomienden a alguna medica piola para tratar a una adolescente con algunos temas de ansiedad. Nada extremo, simplemente que desde hace tiempo, en esos periodos, le cuesta un poco respirar. Ya lo vimos con su pediatra, hizo terapia, y a mi me gustaria que comenzara homeopatia. A ella la idea no le gusta mucho, pero la convenci y creo que, si nos topamos con una profesional piola, puede funcionar muy bien! Idealmente, por la zona de Villa Devoto, Villa del Parque, Villa Luro. Gracias!!', '2019-06-07 09:37:53'),
(513, 'leonor judith', 'cohenleonor@gmail.com', '', 'Buenas tardes\nMe gustaria saber si la Dra LAura reisi atiende en los consultorios privados. De ser asi conocer sus dias y horarios de atencion.\nPor otro lado, emiten factura de consulta medica?\nMuchas gracias\nSaludos', '2019-06-10 14:59:32'),
(514, 'Rodrigo Balladares', 'rdballadares@gmail.com', '1156566434', 'Hola, los molestaba para saber si los médicos del lugar tratan el Lupus. Saludos.', '2019-06-10 17:46:46'),
(515, 'Agustina Gonzalez-Nunez', 'agustina.agonzaleznunez@gmail.com', '54351153482470', 'HAY UNA UNA EXCELENTE MEDICA HOMEOPATA QUE TRABAJA EN CORDOBA CAPITAL? \nCUAL ES SU APELLIDO? \nSINO, A QUIEN ME RECOMIENDA?\nATTE. ', '2019-06-12 13:47:50'),
(516, 'susana beibe', 'info@susanabeibe.com', '1144937502', 'Comienzo 4 sesiones de quimioterapia la semana que viene y quería saber si me podrìan atender para recetarme algùn remedio homeopàtico para las situaciones como nauseas y vomitos, caìda de cabello etc. para ayudarme con esos sintomas!!', '2019-06-14 14:34:51'),
(517, 'Ariel Aman', 'arieleaman@hotmail.com', '2915729335', 'Hola,quería saber si el doctor gabriel bietti ds homeopata registrado!,tengo dudas porque le receto a mi señora pastillas con faustan y otras mas!,gracias!', '2019-06-14 23:22:09'),
(518, 'Victori', 'victoria.weisheim@hotmsil.com', '1135052940', 'Buenas noches. Les escribo pq tengo desprendimiento de retina y y no se puede hacer más nada a nivel médico y quisiera saber si hay algún medicamento homeopático que me ayude con esta patología. Espero su respuesta . Desde ya muchísimas gracias. Victoria', '2019-06-16 22:42:37'),
(519, 'Levitt Josué Emanuel', 'josuelevitt@gmail.com', '221 15 561 6858', 'Soy esquizofrénico paranoide y me dijeron que en Capital federal hay unas escuelas en las que te atienden gratis con alumnos. Quisiera saber si es esta. Pues ya no tengo acceso a la persona que me contó. Desde ya muchas gracias.', '2019-06-22 03:17:19'),
(520, 'Santiago Planas', 'planassantiago@yahoo.com.ar', '297 154435427', 'Buenos días, necesitaría saber numero de teléfono de contacto sobre algún medico homeópata pediátrico que atienda en la ciudad del bolson( Rio Negro) o en la ciudad de Bariloche (Rio Negro). Gracias!', '2019-06-23 14:11:59'),
(521, 'Micaela Camacho', 'm.mica@hotmail.es', '15 51 77 08 6', 'Estoy buscando veterinario homeopata a domicilio en la zona de Caseros, estamos en la calle Marco Polo y Av. San Martín. Aguardo sus comentarios', '2019-06-24 11:37:49'),
(522, 'Alicia Zamudio', 'coachingvital12@gmail.com', '11133807150', 'Buenas tardes . Solicitó información sobre los consultorios privados, y listado de profesionales que atenderían . \nMuchas gracias. \nSaludos cordiales\n', '2019-06-24 15:34:28'),
(523, '  Viviana', 'dra.corvino@gmail.com', '1550359224', 'Buenas tardes, estoy interesada en realizar el curso de medicina homeopatica pero veo en su pagina q el curso ha comenzado en el 2018. Pregunta, se abrira algun nuevo curso durante este año o en el 2020 ..??\nGracias x la informacion\nDra. Viviana Corvino', '2019-06-24 18:49:01'),
(524, 'Violette Bueno', 'violeta.bueno@gmail.com', '+351962184229', 'Hola,\nSoy homeopata, vivo en Lisboa Portugal, y en la mudanza perdi parte de un libro, el autor se llama Scavuzzo, mi madre lo compro en argentina por los años 1960, el titulo  es Homeopatía para todos.\nMe faltan las páginas 1 a 46. No consigo el libro, para comprarlo en ninguna parte. Si lo tienen me pueden escanear esas páginas y mandarmelas a mi email?\nMe avisan el costo. Gracias.\nVb\n\n', '2019-06-25 06:41:56'),
(525, 'Jorge Incorvaia', 'jorgeincorvaia@yahoo.com.ar', '1536770143', 'Desearía un turno para ser atendido en cátedra pero no logro comunicarme telefónicamente. ', '2019-06-26 13:51:17'),
(526, 'Ramon Chavez', 'rachavez@walbro.com', '6682222961', 'Hola, los libros de la tienda online, los pueden enviar a Mexico?, me interesan los libros del Dr. Bernardo Vijnovsky. Gracias.', '2019-06-27 00:55:56'),
(527, 'daniela', 'tmedinadaniela@gmail.com', '', 'Hola , me comunico para consultar si el DR. Agustín Damiano es miembro de la Asociación Médica  Homeopática Argentina?. atienden en Resistencia una vez al mes y quiero asegurarme que sea un profesional.,', '2019-06-30 21:24:58'),
(528, 'sergio', 'spetruzzelli.lemax@live.com.ar', '15 3233 2543', 'Hola buenas tardes quería saber si existe un listado de farmacias homeopatícas a nivel país, si existiera como puedo tener acceso a el.\ngracias', '2019-07-01 19:25:12'),
(529, 'sonia charczyk', 'scharczyk@outlook.com', '1551173118', 'Hola buenos dias.\nLe comento me egrese en la carrera de posgrado de farmaceutico homeopata en el año 2006-2007 , por motivos de fuerza mayor me fui de la provincia de Bs.As. no pudiendo ir a buscar mi titulo .\nActualmente estoy necesitando por causas laborales tener que presentarlo en un posible trabajo, espero a pesar del tiempo pasado lo tengan archivado para poder acceser a el.\ngracias\nSONIA CHARCZYK\nDNI 27948812', '2019-07-02 09:14:52'),
(530, 'Alma Ramos', 'Jouet.2@hotmail.com', '52 5544623202', 'Buen dia. \nMe interesa comprar los tres tomos de materia medica de Vijnovsky. Estoy en Mexico. Quiero saber si hacen envios a mi pais y en este caso cual seria el costo del envio y el tiempo de entrega. \nMuchas gracias. ', '2019-07-02 10:33:18'),
(531, 'ARMANDO BOYADJIAN', 'armandoprensalatina@hotmail.com', '0221 154363433', 'Quisiera saber si conocen algun medico homeópata unicista en la ciudad de LA PLATA, para recomendarme, desde ya gracias.', '2019-07-03 12:52:56'),
(532, 'JimenaTorres', 'jimenatorres81@hotmail.com', '1565341321', 'Buenas tardes, quería consultarles sobre la disponibilidad de turnos para llevar a mi hijo de 2 años y medio.\nTambién si trabajan con obras sociales y sino cual es el valor de la consulta.\nDesde ya, muchas gracias!', '2019-07-03 13:02:59'),
(533, 'victor pacheco sanchez', 'vpachecos@ucsm.edu.pe', '959340470', 'Hola me es grato saludarlos, y a la vez comentarle que estaremos en Buenos Aires del 20 al 27 de julio en una visita con los alumnos de la Maestria en Produccion y Sanidad Animal de la Universidad Catolica de Santa María, realizare,os algunos cursos y visitas por lo cual  tengo a bien solicitarles si podríamos visitarlos en su institución para conocer algo mas del area de medicina alternativa que es de mucho interés a si como informar a los estudiantes graduados la oferta educativa a nivel de postgrado.\nEsperando su respuesta nos despedimos de ustedes', '2019-07-04 02:10:05'),
(534, 'Alejandra ', 'zapallitorelleno@gmail.com', '.', 'Hola! Buenas tardes, les escribo para consultar sobre la atención médica, cuàles son los honorarios y para cuàndo hay turnos disponibles despues de las 18 hs. Gracias, saludos', '2019-07-08 16:54:25'),
(535, 'ROSA ', 'sermonetta@hotmail.com', '1157658859', 'BUSCO UN HOMEOPATA CON ESPECIALIDAD EN GASTROENTEROLOGIA ', '2019-07-10 08:31:40'),
(536, 'Alicia', 'aliborrino49@yahoo.com.ar', '48314077 1562883767', 'Quisiera saber si atiende una  Dra endocrinologa llamada Mercado y si podrían darme un turno y costo de honorarios', '2019-07-12 13:38:00'),
(537, 'graciela', 'gusajpsi@yahoo.com.ar', '15 5564 9959', 'Frecuencia de las consultas y uu honorarios . Gracias', '2019-07-13 10:21:10');
